import React from "react";
import "./PrimaryButtonWithIconDynamic.css";

function PrimaryButtonWithIconDynamic({
  icon,
  children,
  onClick,
  isSearchActive,
}) {
  const className = isSearchActive
    ? "primary-btn-with-icon-dynamic "
    : "primary-btn-with-icon-dynamic-active";
  return (
    <button className="primary-btn-dn-with-icon" onClick={onClick}>
      <img src={icon} alt="" />
      <span>{children}</span>
    </button>
  );
}

export default PrimaryButtonWithIconDynamic;
